    public void printHands()
    {
        String answer = "";
        for (int x = 0;x<hands.length;x++)
        {
            while (hands[x]!=1&&hands[x]!=43)
            {
                if (hands[x]%2==0)
                {
                    answer += "2 ";
                    hands[x]/= 2;
                }
                if (hands[x]%3==0)
                {
                    hands[x]/= 3;
                    answer += "3 ";
                }
                if (hands[x]%5==0)
                {
                    hands[x]/= 5;
                    answer += "4 ";
                }
                if (hands[x]%7==0)
                {
                    hands[x]/= 7;
                    answer += "5 ";
                }
                if (hands[x]%11==0)
                {
                    hands[x]/= 11;
                    answer += "6 ";
                }
                if (hands[x]%13==0)
                {
                    hands[x]/= 13;
                    answer += "7 ";
                }
                if (hands[x]%17==0)
                {
                    hands[x]/= 17;
                    answer += "8 ";
                }
                if (hands[x]%19==0)
                {
                    hands[x]/= 19;
                    answer += "9 ";
                }
                if (hands[x]%23==0)
                {
                    hands[x]/= 23;
                    answer += "t ";
                }
                if (hands[x]%29==0)
                {
                    hands[x]/= 29;
                    answer += "j ";
                }
                if (hands[x]%31==0)
                {
                    hands[x]/= 31;
                    answer += "q ";
                }
                if (hands[x]%37==0)
                {
                    hands[x]/= 37;
                    answer += "k ";
                }
                if (hands[x]%41==0)
                {
                    hands[x]/= 41;
                    answer += "a ";
                }
            }
            if (hands[x]%43==0)
            {
                answer += "Suited ";
            }
            answer += "\n";
            System.out.println(x);
        }
        System.out.println(answer);
    }
    
    /**
     * finds and prints the smallest and largest ints in the list of ints representing hands
     */
    public void arrayRange()
    {
        int high = 0;
        int low = Integer.MAX_VALUE;
        for (int x = 0;x<hands.length;x++)
        {
            int i = hands[x]%(2*1024*1024);
            if (i>high)
                high = i;
            if (i<low)
                low = i;
        }
        System.out.println(high + "  " + low);
    }
    
    /**
     * creates an array in which the int values in the list of hands represents an index on a scattered
     * array, and in each index is the rank of the hand
     */
    public static int[] makeArray()
    {
        int[] array = new int[2096696];
        int[] repeats = new int[100];
        for (int x = 0;x<hands.length;x++)
        {
            int mod = hands[x]%(1024*1024*2);
            if (array[mod] == 0)
                array[mod] = x+1;
            else
                add(repeats,mod);
        }
        for (int x = 0;x<repeats.length;x++)
        {
            array[repeats[x]] = 0;
        }
        return array;
    }
    
    /**
     * finds the fisrt empty space in the array and sets that space to val
     */
    public static void add(int[] x,int val)
    {
        for (int i = 0;i<x.length;i++)
        {
            if (x[i] == 0)
            {
                x[i] = val;
                return;
            }
        }
    }
    
    /**
     * returns true if the given array contains the given int value
     */
    public static boolean contains(int x, int[] array)
    {
        for (int i = 0;i<array.length;i++)
        {
            if (array[i] == x)
                return true;
        }
        return false;
    }
    
